import React, { useState, useEffect } from "react";
import { Modal, Button, Form } from "react-bootstrap";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

const TaskDialog = ({ show, handleClose, handleSave, taskData }) => {
  const [taskTitle, setTaskTitle] = useState("");
  const [description, setDescription] = useState("");
  const [startDate, setStartDate] = useState(new Date());
  const [endDate, setEndDate] = useState(new Date());
  const [priority, setPriority] = useState("Medium");
  const [errors, setErrors] = useState({});
  const [radioValue, setRadioValue] = useState("Medium");

  useEffect(() => {
    if (!taskData) {
      setTaskTitle("");
      setDescription("");
      setStartDate(new Date());
      setEndDate(new Date());
      setPriority("Medium");
      setErrors({});
    } else {
      setTaskTitle(taskData.title);
      setDescription(taskData.description);
      setStartDate(new Date(taskData.startDate));
      setEndDate(new Date(taskData.endDate));
      setPriority(taskData.priority);
      setRadioValue(taskData.priority);
    }
  }, [show, taskData]);

  const validateForm = () => {
    const newErrors = {};
    if (!taskTitle.trim()) newErrors.taskTitle = "Title is required";
    if (!description.trim()) newErrors.description = "Description is required";
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = () => {
    if (validateForm()) {
      handleSave({
        title: taskTitle,
        description,
        startDate,
        endDate,
        priority: radioValue,
      });
      handleClose();
    }
  };

  return (
    <Modal show={show} onHide={handleClose}>
      <Modal.Header
        closeButton
        style={{ backgroundColor: "blue", color: "white" }}
      >
        <Modal.Title>{taskData ? "Edit Task" : "Add Task"}</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <Form>
          <Form.Group controlId="taskTitle" className="mb-3">
            <Form.Control
              type="text"
              value={taskTitle}
              onChange={(e) => setTaskTitle(e.target.value)}
              isInvalid={!!errors.taskTitle}
              placeholder="Title"
              style={{ height: "50px" }}
            />
            <Form.Control.Feedback type="invalid">
              {errors.taskTitle}
            </Form.Control.Feedback>
          </Form.Group>
          <Form.Group controlId="description" className="mb-3">
            <Form.Control
              type="text"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              isInvalid={!!errors.description}
              placeholder="Description"
              style={{ height: "50px" }}
            />
            <Form.Control.Feedback type="invalid">
              {errors.description}
            </Form.Control.Feedback>
          </Form.Group>
          <div className="container px-1 px-sm-5 mx-auto">
            <div className="flex-row d-flex justify-content-center">
              <div className="col-lg-6 col-11 px-1">
                <div className="input-group input-daterange">
                  <input
                    type="text"
                    id="start"
                    className="form-control text-left mr-2"
                    value={startDate}
                    onChange={(e) => setStartDate(e.target.value)}
                  />
                  <label
                    className="ml-3 form-control-placeholder"
                    htmlFor="start"
                  >
                    Start Date
                  </label>
                  <input
                    type="text"
                    id="end"
                    className="form-control text-left ml-2"
                    value={endDate}
                    onChange={(e) => setEndDate(e.target.value)}
                  />
                  <label
                    className="ml-3 form-control-placeholder"
                    htmlFor="end"
                  >
                    End Date
                  </label>
                </div>
              </div>
            </div>
          </div>
          <Form.Group className="mb-3">
            <div className="text-muted">Priority</div>
            <div>
              <div className="form-check form-check-inline">
                <input
                  className="form-check-input"
                  type="radio"
                  name="priorityOptions"
                  id="priorityLow"
                  value="Low"
                  checked={radioValue === "Low"}
                  onChange={() => setRadioValue("Low")}
                />
                <label className="form-check-label" htmlFor="priorityLow">
                  Low
                </label>
              </div>
              <div className="form-check form-check-inline">
                <input
                  className="form-check-input"
                  type="radio"
                  name="priorityOptions"
                  id="priorityMedium"
                  value="Medium"
                  checked={radioValue === "Medium"}
                  onChange={() => setRadioValue("Medium")}
                />
                <label className="form-check-label" htmlFor="priorityMedium">
                  Medium
                </label>
              </div>
              <div className="form-check form-check-inline">
                <input
                  className="form-check-input"
                  type="radio"
                  name="priorityOptions"
                  id="priorityHigh"
                  value="High"
                  checked={radioValue === "High"}
                  onChange={() => setRadioValue("High")}
                />
                <label className="form-check-label" htmlFor="priorityHigh">
                  High
                </label>
              </div>
            </div>
          </Form.Group>
        </Form>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={handleClose}>
          Cancel
        </Button>
        <Button variant="primary" onClick={handleSubmit}>
          {taskData ? "Update" : "Add"}
        </Button>
      </Modal.Footer>
    </Modal>
  );
};

export default TaskDialog;
